<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br><b>WampServer</b> fait référence à une pile de solutions pour le système d'exploitation Microsoft Windows, composée du serveur Web Apache, d'OpenSSL pour le support SSL, de la base de données MySQL et du langage de programmation PHP.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="installation-de-wampserver">Installation de WampServer</a>
</h1>
<div class="Section6"><br>Télécharger WampServer.<br><br><a class="GLink3 Link4" style=" color: lime;" href="https://wampserver.aviatechno.net/" target="_blank">https://wampserver.aviatechno.net/</a><br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Installer WampServer.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Tester WampServer.<br><br><a class="GLink3 Link4" style=" color: lime;" href="http://localhost" target="_blank">http://localhost</a><br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="configuration-du-port">Configuration du port</a>
</h1>
<div class="Section6"><br>Le fichier (httpd.conf) permet configurer le numéro de port du serveur selon votre choix (9001).<br><br><pre class="GCode1 Code1 AceCode" data-mode="txt" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">C:\wamp64\v3.3.0\bin\apache\apache2.4.54.2\conf\httpd.conf</pre><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">Listen 0.0.0.0:9001
Listen [::0]:9001</pre><br></div>
</div></div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="autorisation-des-machines-virtuelles">Autorisation des machines virtuelles</a>
</h1>
<div class="Section6"><br>Le fichier (httpd.conf) permet d'autoriser les machines virtuelles.<br><br><pre class="GCode1 Code1 AceCode" data-mode="txt" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">C:\wamp64\v3.3.0\bin\apache\apache2.4.54.2\conf\httpd.conf</pre><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">LoadModule vhost_alias_module modules/mod_vhost_alias.so
Include conf/extra/httpd-vhosts.conf</pre><br>Ce qu'il faut savoir:<br><br><pre class="GCode1 Code1 AceCode" data-mode="txt" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">mod_vhost_alias.so ---&gt; modules des machines virtuelles
httpd-vhosts.conf ----&gt; configuration des machines virtuelles</pre><br></div></div></div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="configuration-des-machines-virtuelles">Configuration des machines virtuelles</a>
</h1>
<div class="Section6"><br>Le fichier (httpd-vhosts.conf) permet de configurer les machines virtuelles.<br><br><pre class="GCode1 Code1 AceCode" data-mode="txt" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">C:\wamp64\v3.3.0\bin\apache\apache2.4.54.2\conf\extra\httpd-vhosts.conf</pre><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">&lt;VirtualHost *:9001&gt;
    ServerName readyphp.com
    ServerAlias www.readyphp.com
    ServerAdmin readyphp@hotmail.com
    DocumentRoot "C:/dev/php/"
    ErrorLog "C:/dev/php/logs/error.log"
    CustomLog "C:/dev/php/logs/access.log" combined

    &lt;Directory "C:/dev/php/"&gt;
        Options All
        AllowOverride All
        Order allow,deny
        allow from all
        Require all granted
    &lt;/Directory&gt;
&lt;/VirtualHost&gt;</pre><br>Ce qu'il faut savoir:<br><br><pre class="GCode1 Code1 AceCode" data-mode="txt" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">VirtualHost -----&gt; configuration de la machine virtuelle
* ---------------&gt; toutes les adresses IP sont autorisées
9001 ------------&gt; numéro de port du serveur
ServerName ------&gt; nom du serveur
ServerAlias -----&gt; alias du nom du serveur
ServerAdmin -----&gt; adresse email de l'administrateur
DocumentRoot ----&gt; répertoire racine du serveur
ErrorLog --------&gt; fichier log des erreurs (important pour déboguer)
CustomLog -------&gt; fichier log des connexion au serveur (important pour déboguer)

Directory -------&gt; configuration du répertoire racine du serveur
Options ---------&gt; options autorisées
AllowOverride ---&gt; autorisation du fichier htaccess
Order -----------&gt; ordre évaluation des directives
allow -----------&gt; machines autorisées
Require ---------&gt; machines autorisées ou interdites<br></pre><br></div></div></div></div><br><div class="GSection1 Section1">
<div class="Section2">
